def embedding_formatter(emb):
    """Helper for formatting cached embeddings here. 
    Copy the embedding returned from minorminer and then use to break lines.
    Print the output and copy to this file.
    Radomir will replace it with a one-line script.
    """
    emb_str = str(emb)[1:-1]
    emb_formatted = str()
    i = 0
    while i + 200 < len(emb_str):
        next_split = emb_str.find(",", i + 100)
        emb_formatted += emb_str[i:next_split + 1] + "\n"
        i = next_split + 1
    emb_formatted += emb_str[i:]
    return emb_formatted


